export const isAcademic = (email) => {
  if (email.split("@").length === 1) return false;
  if (DomainsInfo.findIndex((el) => el.domain === email.split("@")[1]) === -1)
    return false;
  return true;
};

export const getInstitutionName = (email) => {
  if (email.split("@").length === 1) return "Invalid email!";
  const pos = DomainsInfo.findIndex((el) => el.domain === email.split("@")[1]);
  if (pos === -1) return "Invalid email!";
  return DomainsInfo[pos].name;
};

export const getInstitutionCountry = (email) => {
  if (email.split("@").length === 1) return "Invalid email!";
  const pos = DomainsInfo.findIndex((el) => el.domain === email.split("@")[1]);
  if (pos === -1) return "Invalid email!";
  return DomainsInfo[pos].country;
};
